森永エンジニアリング　ウィンドラジエター　伸縮タイプ　WR-1219　　<br><table width="600" border="0" cellspacing="0" cellpadding="0"><tr><td colspan="2"><table width="600" border="0" cellspacing="0" cellpadding="5"><tr><td bgcolor="#999999"><font color="#FFFFFF" size="5"><strong>　ウィンドーラジエーター　伸縮式　W/R-1219</strong></font><br /><font color="#FFFFFF">森永エンジニアリング　ウィンドウラジエーターヒーター　伸縮　120～190cm</font></td></tr></table><br /></td></tr><tr><td colspan="2" align="center"><img src="http://image.rakuten.co.jp/matsucame/cabinet/wat-06/wat2406-01.jpg" border="0" /><br /><br /></td></tr><tr><td colspan="2"><p><font color="#CC0033" size="4"><strong>窓際の生活を快適にするウインドーラジエーター<br />設置工事不要の窓下専用ヒーターです。</strong></font></p><p><font size="2">家の中と外の温度差が大きくなる冬。外から帰ると、室内は暖かいのに窓際がとても寒い、と感じたことはありませんか？その犯人は窓から忍び込む冷気。普通、建物の壁面には断熱材が入っていますが、窓はガラスだけ。ここから侵入した冷気は下降気流となり、冷たい空気の流れを感じさせるばかりか、床にとどまり足元も冷たくしてしまうのです。『ウインドーラジエーター』は、窓下に設置して暖かな上昇気流を発生させ、窓からの冷気をシャットアウトする新発想の窓下専用ヒーターです。暖房器具の補助アイテムとして、窓からの冷気の侵入を抑え、暖房効率をアップ。効率の良い暖房で足元の冷えを改善、快適生活をサポートします。</font></p><p><img src="http://image.rakuten.co.jp/matsucame/cabinet/wat-06/wat2406-02.gif" border="0" /></p><p><table style="font-size:10pt;" width="590" border="0" cellspacing="5" cellpadding="0"><tr><td colspan="2"><div align="center"><img src="http://www.rakuten.ne.jp/gold/matsucame/pic_data/tukattemita.jpg" border="0"></div></td></tr><tr><td width="300" align="center"><img src="http://image.rakuten.co.jp/matsucame/cabinet/wat-06/wat2406-t001.jpg" border="0"></td><td width="295"><strong>ウインドーラジエーター<br>窓下暖房　補助ヒーター　伸縮式ヒーター</strong><br>おすすめです。<br><br><br>部屋がなかなか暖まらないという悩みで、暖房出力の高いファンヒーターを購入したり、エアコンの設定温度を高くしている方も多いと思います。<br><br>そんなときは　ウインドラジエーターヒーターが効果的です。</td></tr><tr><td colspan="2"><hr></td></tr><tr><td width="300" align="center"><img src="http://image.rakuten.co.jp/matsucame/cabinet/wat-06/wat2406-t002.jpg" border="0"></td><td width="295">ウィンドーラジエーターを設置すると、<br><br>1.窓際からの冷気防止<br>2.窓ガラスの結露抑制<br>3.足元暖房<br>4.補助暖房<br><br>などいろいろな使い道が！<br>暖房効率をアップ！！</td></tr><tr><td colspan="2"><hr></td></tr><tr><td width="300" align="center"><img src="http://image.rakuten.co.jp/matsucame/cabinet/wat-06/wat2406-t003.jpg" border="0"></td><td width="295">置くだけのラクラク設置。<br>工事は必要ありません。<br><br>トイレ暖房やスポット暖房にも便利な　ウィンドラジエーター　マルチヒーター<br><br><br>省エネ設計なので、設定温度を上げたり、大きな暖房器を使うより、電気代や燃料代を抑えられます。<br><br>しかも伸縮式なので、窓のサイズに合わせて使うことが出来ます。</td></tr><tr><td colspan="2"><hr></td></tr></table></p><p>&nbsp;</p></td></tr><tr><td colspan="2" align="center"><table width="600" border="0" cellspacing="0" cellpadding="2"><tr><td><img src="http://image.rakuten.co.jp/matsucame/cabinet/wat-06/wat2406-03.gif" border="0" /></td><td><img src="http://image.rakuten.co.jp/matsucame/cabinet/wat-06/wat2406-04.gif" border="0" /></td></tr><tr><td><img src="http://image.rakuten.co.jp/matsucame/cabinet/wat-06/wat2406-05.gif" border="0" /></td><td><img src="http://image.rakuten.co.jp/matsucame/cabinet/wat-06/wat2406-06.gif" border="0" /></td></tr><tr><td><img src="http://image.rakuten.co.jp/matsucame/cabinet/wat-06/wat2406-07.gif" border="0" /></td><td>&nbsp;</td></tr></table><br /></td></tr><tr><td colspan="2" align="center"><table width="600" border="0" cellspacing="0" cellpadding="5"><tr><td bgcolor="#FFCCFF">各種暖房との併用でさらに高まる暖房効果</td></tr><tr><td><p>■床暖房の場合</p><p><font size="2">一般的に床暖房は部屋全体に設置することは難しく、冷気の影響により窓付近の床は冷たくなっています。</font><br /><img src="http://image.rakuten.co.jp/matsucame/cabinet/wat-06/wat2406-08.gif" border="0" /></p><p>&nbsp;</p></td></tr><tr><td><p>■温風暖房の場合（エアコン・ファンヒーター）</p><p><font size="2">温風式の場合、部屋上部に熱がたまりやすく、足元が暖まりにくい。<br />頭上は暑いくらいなのに、窓からくる冷気で足元は冷えたまま…</font><br /><img src="http://image.rakuten.co.jp/matsucame/cabinet/wat-06/wat2406-09.gif" border="0" /></p><p>&nbsp;</p></td></tr></table></td></tr><tr><td colspan="2" align="center"><img src="http://image.rakuten.co.jp/matsucame/cabinet/wat-06/wat2406-00.jpg" border="0" /><br><br><br></td></tr><tr><td colspan="2" align="center"><font color="#FF0000" size="6"><strong>NEWカラーも登場しました！</strong></font><br /><img src="http://image.rakuten.co.jp/esteyou/cabinet/wat-03/wat2406-br.jpg" border="0" /><br><img src="http://image.rakuten.co.jp/esteyou/cabinet/wat-03/wat2406-st.jpg" border="0" /><br><img src="http://image.rakuten.co.jp/nihontuuhan/cabinet/wat-01/wat2406-ms.jpg" border="0" /><br><br /></td></tr><tr><td colspan="2"><table width="560" border="1" cellspacing="0" cellpadding="10" bordercolor="#663300"><tr><td><font size="2" face="ＭＳ ゴシック, MS Gothic, Osaka－等幅, Osaka-mono, monospace"><font color="#663300"><strong>窓際の冷気をシャットアウトする、すぐれた窓専用ヒーター</strong></font><br /><br />●スライド構造により、窓幅にあわせて本体の長さ調節ができます。（120～190cm）<br /><br />●本体表面温度は約60℃位。手が触れても安心です。<br />　※長時間ふれていると低温やけどをすることがあります。<br /><br />●暖めすぎを防ぎ、電気代も抑えられます。<br />　1日8時間使用しても…　約19円!経済的です。<br /><br />●窓の下に置いて電源プラグを入れるだけ。設置工事の必要はありません。<br /><br />●冬場の室内外の温度差によって生じる窓ガラスの結露抑制にも高い効果を発揮します</font></td></tr></table><br /><br /><br /></td></tr><tr><td width="202" align="center"><img src="http://image.rakuten.co.jp/matsucame/cabinet/wat-06/window_image1.jpg" width="200" border="0" /></td><td width="398" align="center"><table style="font-size:10pt;" width="398" border="1" cellspacing="0" cellpadding="5"><tr align="center"><td width="80">商品名</td><td>ウィンドーラジエーター　伸縮式　W/R-1219</td></tr><tr align="center"><td>サイズ</td><td>W1200～1900×D47×H56mm</td></tr><tr align="center"><td>重量</td><td>約1.73kg</td></tr><tr align="center"><td>消費電力</td><td>120W</td></tr><tr align="center"><td>材質</td><td>発熱部：アルミニウム<br />樹脂部：耐熱ABS樹脂</td></tr><tr align="center"><td>安全装置</td><td>バイメタルサーモ・ヒューズ</td></tr><tr align="center"><td>区分</td><td>暖房器具</td></tr><tr align="center"><td>広告文責</td><td>株式会社マツムラカメラ　076-242-1122</td></tr></table></td></tr></table><br><br><img src="http://image.rakuten.co.jp/esteyou/cabinet/img-2/pre2.gif"><br><br><br><img src="http://image.rakuten.co.jp/matsucame/cabinet/choice5-omake2.jpg"><br><br><font color="#ff0000" size="2">※おまけはお一人様につき１点となります</font><br><br><table width="400" border="1" cellspacing="0" cellpadding="3"><tr><td><font size="2">通販　口コミ　クチコミ　レビュー<br /><a style="text-decoration:none" hr