2">一般的に床暖房は部屋全体に設置することは難しく、冷気の影響により窓付近の床は冷たくなっています。</font><br /><img border="0" src="http://image.rakuten.co.jp/matsucame/cabinet/wat-06/wat2406-08.gif" height="137" width="533" /></p><p>&nbsp;</p></td></tr><tr><td><p>■温風暖房の場合（エアコン・ファンヒーター）</p><p><font size="2">温風式の場合、部屋上部に熱がたまりやすく、足元が暖まりにくい。<br />頭上は暑いくらいなのに、窓からくる冷気で足元は冷えたまま…</font><br /><img border="0" src="http://image.rakuten.co.jp/matsucame/cabinet/wat-06/wat2406-09.gif" height="140" width="533" /></p><p>&nbsp;</p></td></tr></table></td></tr><tr><td align="center" colspan="2"><img border="0" src="http://image.rakuten.co.jp/matsucame/cabinet/wat-06/wat2408-00.jpg" height="110" width="299" /></td></tr><tr><td align="center" colspan="2">&nbsp;</td></tr><tr><td colspan="2"><table border="1" bordercolor="#663300" cellpadding="10" cellspacing="0" width="560"><tr><td><font face="ＭＳ ゴシック, MS Gothic, Osaka－等幅, Osaka-mono, monospace" size="2"><font color="#663300"><strong>窓際の冷気をシャットアウトする、すぐれた窓専用ヒーター</strong></font><br /><br />●本体表面温度は約60℃位。手が触れても安心です。<br />　※長時間ふれていると低温やけどをすることがあります。 <br /><br />●暖めすぎを防ぎ、電気代も抑えられます。<br />　1日8時間使用しても…　約7円!経済的です。 <br /><br />●窓の下に置いて電源プラグを入れるだけ。設置工事の必要はありません。 <br /><br />●冬場の室内外の温度差によって生じる窓ガラスの結露抑制にも高い効果を発揮します<br /><br />※定尺タイプはスライドによる伸縮は出来ません。窓にあわせた長さをお選び下さい。</font></td></tr></table><br /><br /><br /></td></tr><tr><td align="center" width="202"><img border="0" src="http://image.rakuten.co.jp/matsucame/cabinet/wat-06/window_image1.jpg" width="200" height="300" /></td><td align="center" width="398"><table border="1" cellpadding="5" cellspacing="0" style="font-size: 10pt;" width="398"><tr align="center"><td width="80">商品名</td><td>ウィンドーラジエーター　定尺　W/R-600</td></tr><tr align="center"><td>サイズ</td><td>W600×D36×H57mm</td></tr><tr align="center"><td>重量</td><td>約0.50kg</td></tr><tr align="center"><td>消費電力</td><td>40W</td></tr><tr align="center"><td>材質</td><td>発熱部：アルミニウム<br />樹脂部：耐熱ABS樹脂</td></tr><tr align="center"><td>安全装置</td><td>バイメタルサーモ・ヒューズ</td></tr><tr align="center"><td>区分</td><td>暖房器具</td></tr